import React from 'react';
import Pokedex from './components/pokedex/pokedex.component';

import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      score1: 0,
      score2: 0,
    }
  }

  render() {
    return (
      <div className="App">
        <Pokedex key={1} hand='1' />
        <Pokedex key={2} hand='2' />
      </div>
    );
  }
}

export default App;
